import React from 'react';

class Form extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            validation: {
                rules: {},
                messages: {},
                valid: false,
            },
            formValue: {}
        }
    }
    componentDidMount() {
        let x = [
            {
                size:1,
                value:2
            },
            {
                size:5,
                value:8
            },
            {
                size:6,
                value:36
            },
            {
                size:10,
                value:70
            },
        ];
        let str = '';
        for (let y=0; y<15; y++) {
            str += `<td></td>`;
        }
        console.log(str);
        // console.log(this.props.config);
    }
    render() {

        return (
            <form name={this.props.config.name}>
                
            </form>
        );
    }
}

export default Form;
